import React from 'react'

function FetchData3(props) {
  const handler = function(){

  };

  var listItems = props.items.map(function(item, index){
    return (
      <li key={index} onClick={ handler }>
        {item.text}
        <p>My name is Ali</p>
        <h>My name is Abbas</h>
      </li>
    )
  });

  return (
    <div>
      <ul>
        {listItems}
        
      </ul>
    </div>
  )
  }
  
  export default FetchData3;
